function initializeAmplify(){const awsConfig={Auth:{region:"us-west-2",userPoolId:"REPLACE_WITH_YOUR_USER_POOL_ID",userPoolWebClientId:"REPLACE_WITH_YOUR_CLIENT_ID",mandatorySignIn:true},Storage:{AWSS3:{bucket:"REPLACE_WITH_YOUR_S3_BUCKET_NAME",region:"us-west-2"}},API:{endpoints:[{name:"resumeUploadApi",endpoint:"REPLACE_WITH_YOUR_API_GATEWAY_URL/upload-file",region:"us-west-2"},{name:"audioUploadApi",endpoint:"REPLACE_WITH_YOUR_API_GATEWAY_URL/upload-audio",region:"us-west-2"}]}};AWS.Amplify.configure(awsConfig);console.log("AWS Amplify initialized successfully")}window.initializeAmplify=initializeAmplify;document.addEventListener("DOMContentLoaded",function(){try{initializeAmplify()}catch(error){console.error("Error initializing AWS Amplify:",error)}});